import React, { Component } from 'react'

import Items from '../api/controller/buscarterminos.php'
import {
    BrowserRouter as Router,
    Route,
    Link,
    Switch
    
  } from 'react-router-dom'
class Nav extends Component{
    render(){
        return(
            <Router>
                <nav>
                    <ul>
                        <li>
                            <Link to="/buscarterminos">Items</Link>
                        </li>
                    </ul>
                </nav>
                <Switch>
                    <Route path="/buscarterminos" component={Items}/>
                </Switch>
            </Router>
        );
    }

}
export default Nav;
